import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './recipes-from-cat.css';

function RecipeListing(props){
  return(
    <li>
      <Link to='../recipe-page/'>{props.name}</Link>
    </li>
  )
}

export default function RecipesFromCat(){
  // const listingItems= ``   aici pun linku de fetch care sa imi aduca retete care au la category acelasi id
    //apoi fac fetch aici
  return (
    
    <div className='recipe-container'>
      <h3>Recipes</h3>
    </div>
  )
}
